const React=require("react");

function Job(props){
return (<div className="job">
        <h4 className="heading4">{props.heading}</h4>
        <h2 className="title4">{props.title}</h2>
        <i class="fa-regular fa-briefcase-blank"></i><p className="textt">{props.text}</p>
        <p className="location2">{props.location}</p>
        <button className=" button2 btn btn-light" type="button"><span>Apply on Timejobs</span></button>
        <img className="pp4" src={props.pp}></img><h3 className="name4">{props.name}</h3>
        <h4 className="views4">{props.views}</h4>
    </div>);
}

export default Job;
